import Vue from 'vue'
// import VuePDFViewer from './VuePDFViewer.vue'
import VuePDFViewer from '../'

/* eslint-disable no-new */
new Vue({
  el: '#app',
  data: {
    test: 'Test',
    url: 'https://bitcoin.org/bitcoin.pdf'
  },
  components: {
    'vue-pdf-viewer': VuePDFViewer
  },
  methods: {
    exp: function () {
      if (this.url == '/static/pdftest.pdf')
        this.url = 'https://bitcoin.org/bitcoin.pdf';
      else
        this.url = '/static/pdftest.pdf'
    }
  }
});
